import React from "react";
import styled from "styled-components";
import Header from "../components/header/Header";
import BodyLayout from "../components/body/BodyLayout";
import Footer from "../components/footer/Footer";
import KakaoMap from "../components/body/map/KakaoMap";
import LineSelector from "../components/body/map/metorMap/LineSelector";
import Line2 from "../components/body/map/metorMap/line2/Line2";
import Line8 from "../components/body/map/metorMap/line8/Line8";

const PlannerContainer = styled.div`
  width: 80vw;
  height: 80vh;
  margin-top: var(--margin-header-to-body);
  display: flex;
  justify-content: center;
`;

const Conditioner = styled.div`
  width: 32vw;
  height: 80vh;
  background-color: black;
`;

const Planning = () => {
  return (
    <>
      <Header />
      <BodyLayout>
        <PlannerContainer>
          <LineSelector />
          {/* 표준모드 적용이 안되어 있어서 이미지가 깨진다(doctype html) => 하나씩 찍는 방법을 찾든지, 포토샵에서 표준모드 적용하는 방법을 찾든지 */}
          {/* <Line2 /> */}
          <Line8 />
          {/* <Conditioner /> */}
          {/* <KakaoMap /> */}
        </PlannerContainer>
      </BodyLayout>
      <Footer />
    </>
  );
};

export default Planning;
